Y\",\n   \"snippet\": {\n    \"publishedAt\": \"2012-02-08T21:07:19.000Z\",\n    \"channelId\": \"UCAeRP44QtKybmsR7oNbmR0g\",\n    \"title\": \"Pitch and Octaves\",\n    \"description\": \"Pitch refers to how high or low a sound is.  We have a good sense of what high and low pitched sound are, even if we've not spoken about them in this way.  \\n\\nAll sounds are created when an object vibrates and the pitch of a sound depends on the pitch of this vibration.  The faster the vibration the higher in pitch the sound.  \\n\\nIf we double the speed of vibration (or frequency) of a sound then something interesting happens.  The two pitches will sound similar and will blend together well.  This special relationship is known as an octave and is a central part of almost all music around the world.  \\n\\nVisit http://www.daveconservatoire.org to watch hundreds of free video music lessons just like this one and complete interactive exercises to practice your skills!\",\n    \"thumbnails\": {\n     \"default\": {\n      \"url\": \"https://i.ytimg.com/vi/aDutr6g8SeY/default.jpg\",\n      \"width\": 120,\n      \"height\": 90\n     },\n     \"medium\": {\n      \"url\": \"https://i.ytimg.com/vi/aDutr6g8SeY/mqdefault.jpg\",\n      \"width\": 320,\n      \"height\": 180\n     },\n     \"high\": {\n      \"url\": \"https://i.ytimg.com/vi/aDutr6g8SeY/hqdefault.jpg\",\n      \"width\": 480,\n      \"height\": 360\n     },\n     \"standard\": {\n      \"url\": \"https://i.ytimg.com/vi/aDutr6g8SeY/sddefault.jpg\",\n      \"width\": 640,\n      \"height\": 480\n     },\n     \"maxres\": {\n      \"url\": \"https://i.ytimg.com/vi/aDutr6g8SeY/maxresdefault.jpg\",\n      \"width\": 1280,\n      \"height\": 720\n     }\n    },\n    \"channelTitle\": \"Dave Conservatoire\",\n    \"tags\": [\n     \"pitch\",\n     \"frequency\",\n     \"what is pitch\",\n     \"octaves\",\n     \"octave\",\n     \"octave relationship\",\n     \"music theory\",\n     \"music\",\n     \"online music lessons\"\n    ],\n    \"categoryId\": \"27\",\n    \"liveBroadcastContent\": \"none\",\n    \"localized\": {\n     \"title\": \"Pitch and Octaves\",\n     \"description\": \"Pitch refers to how high or low a sound is.  We have a good sense of what high and low pitched sound are, even if we've not spoken about them in this way.  \\n\\nAll sounds are created when an object vibrates and the pitch of a sound depends on the pitch of this vibration.  The faster the vibration the higher in pitch the sound.  \\n\\nIf we double the speed of vibration (or frequency) of a sound then something interesting happens.  The two pitches will sound similar and will blend together well.  This special relationship is known as an octave and is a central part of almost all music around the world.  \\n\\nVisit http://www.daveconservatoire.org to watch hundreds of free video music lessons just like this one and complete interactive exercises to practice your skills!\"\n    }\n   }\n  },\n  {\n   \"kind\": \"youtube#video\",\n   \"etag\": \"\\\"q5k97EMVGxODeKcDgp8gnMu79wM/KHllfVCKmZ__UFfoncTa-fwmt-A\\\"\",\n   \"id\": \"nVkeCH3GA9s\",\n   \"snippet\": {\n    \"publishedAt\": \"2012-02-08T23:17:54.000Z\",\n    \"channelId\": \"UCAeRP44QtKybmsR7oNbmR0g\",\n    \"title\": \"The 12 Pitches\",\n    \"description\": \"In Western music, we split the octave up into 12 different pitches.  These twelve pitches are used to create almost all of our music.  \\n\\nOne of the best ways to learn about how we think about these twelve pitches is to look at the piano keyboard where they are clearly laid out for us.  \\n\\nThe first thing you might notice is that the white and black keys follow a certain pattern and this helps us to understand how the 12 basic pitches are organised.  The white notes on the piano are named after the first seven letters of the alphabet - A B C D E F G.  \\n\\nThe black notes fill in the pitches between these letter named notes.  We talk about these notes as being - flats and sharps.  \\n\\n Visit http://www.daveconservatoire.org to watch hundreds of free video music lessons just like this one and complete interactive exercises to practice your skills!\",\n    \"thumbnails\": {\n     \"default\": {\n      \"url\": \"https://i.ytimg.com/vi/nVkeCH3GA9s/default.jpg\",\n      \"width\": 120,\n      \"height\": 90\n     },\n     \"medium\": {\n      \"url\": \"https://i.ytimg.com/vi/nVkeCH3GA9s/mqdefault.jpg\",\n      \"width\": 320,\n      \"height\": 180\n     },\n     \"high\": {\n      \"url\": \"https://i.ytimg.com/vi/nVkeCH3GA9s/hqdefault.jpg\",\n      \"width\": 480,\n      \"height\": 360\n     },\n     \"standard\": {\n      \"url\": \"https://i.ytimg.com/vi/nVkeCH3GA9s/sddefault.jpg\",\n      \"width\": 640,\n      \"height\": 480\n     },\n     \"maxres\": {\n      \"url\": \"https://i.ytimg.com/vi/nVkeCH3GA9s/maxresdefault.jpg\",\n      \"width\": 1280,\n      \"height\": 720\n     }\n    },\n    \"channelTitle\": \"Dave Conservatoire\",\n    \"tags\": [\n     \"note names\",\n     \"letter names for music notes\",\n     \"piano keyboard\",\n     \"piano layout\",\n     \"music theory\",\n     \"music\",\n     \"online music lessons\"\n    ],\n    \"categoryId\": \"27\",\n    \"liveBroadcastContent\": \"none\",\n    \"localized\": {\n     \"title\": \"The 12 Pitches\",\n     \"description\": \"In Western music, we split the octave up into 12 different pitches.  These twelve pitches are used to create almost all of our music.  \\n\\nOne of the best ways to learn about how we think about these twelve pitches is to look at the piano keyboard where they are clearly laid out for us.  \\n\\nThe first thing you might notice is that the white and black keys follow a certain pattern and this helps us to understand how the 12 basic pitches are organised.  The white notes on the piano are named after the first seven letters of the alphabet - A B C D E F G.  \\n\\nThe black notes fill in the pitches between these letter named notes.  We talk about these notes as being - flats and sharps.  \\n\\n Visit http://www.daveconservatoire.org to watch hundreds of free video music lessons just like this one and complete interactive exercises to practice your skills!\"\n    }\n   }\n  },\n  {\n   \"kind\": \"youtube#video\",\n   \"etag\": \"\\\"q5k97EMVGxODeKcDgp8gnMu79wM/9d3VajCkLdFZGbII1WJO2HcUW8g\\\"\",\n   \"id\": \"hPou3ube_Rg\",\n   \"snippet\": {\n    \"publishedAt\": \"2012-02-10T23:58:31.000Z\",\n    \"channelId\": \"UCAeRP44QtKybmsR7oNbmR0g\",\n    \"title\": \"Tones and Semitones\",\n    \"description\": \"A useful way to measure pitch is to work out how far apart two notes are in terms of their pitch. \\n\\nWe already know about octaves as one measure of pitch, but what about for smaller steps up and down in pitch. \\n\\nTo measure these distances we can talk about tones and semitones.  On a keyboard instrument like a piano or organ each of the keys is one semitone apart.  The distance between C and C#, for example, is one semitone.  \\n\\nA tone is simply a distance in pitch of two tones.  F to G, for example is a distance of a tone.  \\n\\n Visit http://www.daveconservatoire.org to watch hundreds of free video music lessons just like this one and complete interactive exercises to practice your skills!\",\n    \"thumbnails\": {\n     \"default\": {\n      \"url\": \"https://i.ytimg.com/vi/hPou3ube_Rg/default.jpg\",\n      \"width\": 120,\n      \"height\": 90\n     },\n     \"medium\": {\n      \"url\": \"https://i.ytimg.com/vi/hPou3ube_Rg/mqdefault.jpg\",\n      \"width\": 320,\n      \"height\": 180\n     },\n     \"high\": {\n      \"url\": \"https://i.ytimg.com/vi/hPou3ube_Rg/hqdefault.jpg\",\n      \"width\": 480,\n      \"height\": 360\n     },\n     \"standard\": {\n      \"url\": \"https://i.ytimg.com/vi/hPou3ube_Rg/sddefault.jpg\",\n      \"width\": 640,\n      \"height\": 480\n     },\n     \"maxres\": {\n      \"url\": \"https://i.ytimg.com/vi/hPou3ube_Rg/maxresdefault.jpg\",\n      \"width\": 1280,\n   